import react from 'react'

function Card(){

    let products = {
        "soda":[
            "pepsi",
            "coke",
            "7up",
            "sprite",
            "fanta",
            "mountain dew",
            "dr pepper",
            "root beer",
            "mug",

        ]
    }
    return(
        <div>
            <h1>Products</h1>
             <div id='parent-container' >

                {products.soda.map((soda, index) => (
            <div className='product-card' key={index}>{soda}</div>
         ))}
        </div>
        </div>
    )
}


export default Card
